import { IconButton } from '@material-ui/core';
import AddIcon from '@material-ui/icons/Add';
import React from 'react';

class UkAddButton extends React.Component {
  render() {
    return (
      <IconButton arial-labe="Add UK">
        <AddIcon />
      </IconButton>
    );
  }
}

export default UkAddButton;
